    <script>
        var getEL = selector => document.querySelector(selector);
        var ReSize = (selector, obj) => Object.keys(obj).forEach(key => selector.style[key] = obj[key]);
        
        var video = getEL('video');
        enableInlineVideo(video, {
            iPad: true
        });
        
        var _START = () => {
            var s = _MBSTR.windowSize();
            
            ReSize(video, {
                "width" : s.iw < s.ih ? 'auto' : '100%',
                "height" : s.iw < s.ih ? '100%' : 'auto',
            });
        }
        
        video.onloadedmetadata = () => {
            video.play();
            getEL('#previewer').parentNode.removeChild(getEL('#previewer'));
            _START();
            getEL('#content_box').classList.toggle('show_box');
            getEL('#wrapper_background').classList.toggle('show_bg');
            getEL('#content_box').addEventListener('click', _MBSTR.targetURL);
        }
        
        window.onresize = () => {
            _START();
        }
    </script>
